import React from 'react'

const Table=({props})=>
    <table className="table">
        <thead className="thead-dark">
        <tr>
            <th scope="col">Date</th>
            <th scope="col">Round</th>
            <th scope="col">Score</th>
        </tr>
        </thead>
        <tbody>
        {(props.map( (item, index) => {
            return (
                <tr>
                    <th scope="row">{item.date}</th>

                </tr>
            )
        }))
        };
        </tbody>
    </table>


